    // const filtered = categories.filter(category => {
    //     return category.id === props.name;
    // });

    console.log(JSON.parse(props.name))

    const socials = JSON.parse(props.name);


    return (
        <div>




            {
                socials.fb === true ?
                    <div>
                        <p>Yes</p>
                    </div>
                    :

                    <div>
                        <p>No</p>
                    </div>






            }






        </div>
    );
}

export default Socials;
